import React, { useState } from 'react';
import styles from './AddUser.module.css'; // Import CSS module
import axios from 'axios'; // Import axios

const AddUser = () => {
  const [activeTab, setActiveTab] = useState('admin');
  const [formData, setFormData] = useState({
    role_type: 'student',
    first_name: '',
    middle_name: '',
    last_name: '',
    sex: 'F',
    student_phone_no: '',
    email: '',
    address: '',
    dob: '',
    dept_id: '',
    semester: '',
    guardian_name: '',
    guardian_phone_no: ''
  });
  const handleInputChange = (e) => {
    const { name, value } = e.target;
    // Map "male" to "M", "female" to "F", and "other" to "O"
    const transformedValue = value === "male" ? "M" : value === "female" ? "F" : "O";
    setFormData({ ...formData, [name]: transformedValue });
  };

  const handleTabChange = (tab) => {
    setActiveTab(tab);
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    try {
      const response = await axios.post('http://127.0.0.1:5000/api/v1/admin/createUser', formData);
      console.log(response.data); // Log response data if needed
      // Clear form data after successful submission
      setFormData({
        role_type: 'student',
        first_name: '',
        middle_name: '',
        last_name: '',
        sex: '',
        student_phone_no: '',
        email: '',
        address: '',
        dob: '',
        dept_id: '',
        semester: '',
        guardian_name: '',
        guardian_phone_no: ''
      });
    } catch (error) {
      console.error('Error creating user:', error.message);
    }
  };

  return (
    <div className={styles.main}>
      <div className={styles.info}>
        <div className={styles.tabs}>
          <button onClick={() => handleTabChange('admin')} className={activeTab === 'admin' ? styles.active : ''}>Admin</button>
          {/* Add buttons for other tabs as needed */}
        </div>
        <div className={styles.scrollableContent}>
          <div className={styles.tabContent}>
            {activeTab === 'admin' && (
              <form onSubmit={handleSubmit} className={styles.form}>
                <h1>Create Admin</h1>
                <table className={styles.formTable}>
                  <tbody>
                    <tr className={styles.formRow}>
                      <td>
                        <label>
                          First Name:
                          <input type="text" name="first_name" value={formData.first_name} onChange={handleInputChange} />
                        </label>
                      </td>
                      <td>
                        <label>
                          Middle Name:
                          <input type="text" name="middle_name" value={formData.middle_name} onChange={handleInputChange} />
                        </label>
                      </td>
                      <td>
                        <label>
                          Last Name:
                          <input type="text" name="last_name" value={formData.last_name} onChange={handleInputChange} />
                        </label>
                      </td>
                    </tr>
                    <tr className={styles.formRow}>
                      <td>
                        <label>
                          Email:
                          <input type="text" name="email" value={formData.email} onChange={handleInputChange} />
                        </label>
                      </td>
                    </tr>
                    <tr>
                      <td colSpan="3">
                        <button type="submit">Submit</button>
                      </td>
                    </tr>
                  </tbody>
                </table>
              </form>
            )}
            {/* Add forms for other user roles as needed */}
          </div>
        </div>
      </div>
    </div>
  );
}

export default AddUser;
